This Home Sweet Home crate was a crate I had laying around the house so I decided to give it a new look with some wood burning. I added a few stars in the words on one side while the other side has Live Love Laugh on it. I then sealed it with a few coats of Polycrylic finish to protect it. I love how it came out.

Length - 15&quot;
Width   - 8 1/8&quot;
Height -  4&quot;
